import React from "react";
import "bootstrap/dist/css/bootstrap.min.css"; // Ensure Bootstrap CSS is imported
import logo from "./assets/logo.png";
import animals from "./assets/animals.png";
import protection from "./assets/protection.png";
import lungs from "./assets/lungs.png";
import food from "./assets/food.png";
import mind from "./assets/mind.png";
import doge from "./assets/vetdoge.jpg";
import tic from "./assets/tic.png";

// Data for the feature cards
const features = [
  {
    img: protection,
    title: "Защита от зарази",
    description:
      "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sem velit viverra amet faucibus.",
  },
  {
    img: lungs,
    title: "100% възтановяване",
    description:
      "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sem velit viverra amet faucibus.",
    highlighted: true,
  },
  {
    img: food,
    title: "Натурални съставки",
    description:
      "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sem velit viverra amet faucibus.",
  },
  {
    img: mind,
    title: "Без травми",
    description:
      "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sem velit viverra amet faucibus.",
  },
];

// Data for the benefits list
const benefits = [
  "Lorem ipsum dolor sit amet, consectetur adipiscing elit.",
  "Lorem ipsum dolor sit amet, consectetur adipiscing elit.",
  "Lorem ipsum dolor sit amet, consectetur adipiscing elit.",
  "Lorem ipsum dolor sit amet, consectetur adipiscing elit.",
  "Lorem ipsum dolor sit amet, consectetur adipiscing elit.",
];

function App() {
  return (
    <div className="container py-5">
      {/* Header section with a background image */}
      <div
        className="row justify-content-center align-items-center bg-light position-relative border-bottom border-dark min-vh-100"
        style={{
          backgroundImage: `url(${animals})`,
          backgroundSize: 'cover', // Ensures the image covers the entire section
          backgroundPosition: 'center', // Centers the background image
          backgroundRepeat: 'no-repeat', // Prevents the image from repeating
          backgroundAttachment: 'fixed', // Keeps the background fixed on scroll
        }}
      >
        <div className="col-12 p-0 d-flex justify-content-center align-items-center position-relative">
          <h1 className="text-white display-3 fw-bold position-relative text-center">
            Welcome to Our Site
          </h1>
        </div>
      </div>

      {/* Responsive image adjustment */}
      <style jsx="true">{`
        @media (max-width: 768px) {
          .bg-light {
            background-size: contain; // Ensures the whole image fits within the section
            background-position: center top;
          }
        }
      `}</style>

      {/* Logo section */}
      <div className="row justify-content-center py-3">
        <div className="col-md-6 text-center">
          <img
            src={logo}
            alt="Bio Logo"
            className="img-fluid"
          />
        </div>
      </div>

      {/* Main text */}
      <div className="row py-3">
        <div className="col-12 text-center">
          <h1 className="display-3" style={{ fontFamily: "'Lobster', cursive" }}>
            Грижим се за тяхното здраве
          </h1>
        </div>
      </div>

      {/* Feature cards section */}
      <div className="row justify-content-center py-3">
        {features.map((feature, index) => (
          <div key={index} className="col-12 col-md-6 col-lg-3 mb-4">
            <div
              className={`card p-3 border rounded ${
                feature.highlighted ? "bg-primary text-white" : "bg-light"
              }`}
            >
              <img
                src={feature.img}
                alt={`${feature.title} Icon`}
                className="card-img-top img-fluid mb-2 mx-auto"
                style={{ maxWidth: "92px", maxHeight: "92px", objectFit: "cover" }}
              />
              <div className="card-body">
                <h5 className="card-title fs-4 fw-bold">{feature.title}</h5>
                <p className="card-text fs-6">{feature.description}</p>
              </div>
            </div>
          </div>
        ))}
      </div>

      {/* Choose us section */}
      <div className="row py-5">
        <div className="col-md-6 mb-4 mb-md-0">
          <img
            src={doge}
            alt="Decorative"
            className="img-fluid rounded border border-0"
            style={{ borderRadius: "10px" }}
          />
        </div>
        <div className="col-md-6">
          <h1 className="display-4 fw-bold">Защо да изберете нас?</h1>
          <ul className="list-unstyled">
            {benefits.map((benefit, index) => (
              <li key={index} className="d-flex align-items-center mb-3 fs-6">
                <img src={tic} alt="Check" className="me-2" />
                {benefit}
              </li>
            ))}
          </ul>
          <a
            href="#"
            className="btn btn-link fs-6 fw-medium text-primary"
          >
            Learn More →
          </a>
        </div>
      </div>
    </div>
  );
}

export default App;
